import { Countdown } from "components/countdown";
import { ErrorPage } from "components/error";
import { COUNTDOWN_MENU_LINKS, LIVE_DATE, URLS } from "config";
import { FaqPage, HomePage, PricingPage, TeamPage } from "pages";
import { LandingPage } from "pages/LandingPage";
import { NOT_FOUND_ROUTE } from "pages/NOT_FOUND";
import { createBrowserRouter, RouteObject } from "react-router-dom";
import { IRoute } from "types";

export const ROUTE_TREE = createBrowserRouter(([
  {
    path: URLS.__root__,
    element: <LandingPage menuLinks={COUNTDOWN_MENU_LINKS} />,
    children: [
      {
        path: URLS.countdown,
        element: <Countdown targetDate={LIVE_DATE} />,
      },
    ],
  },
  {
    path: URLS.home,
    element: <LandingPage.WithMenus />,
    errorElement: <ErrorPage />,
    children: [
      {
        path: "",
        element: <HomePage />,
        handle: { title: "" },
      },
      {
        path: URLS.faq,
        element: <FaqPage />,
        handle: { title: "FAQ" },
      },
      {
        path: URLS.team,
        element: <TeamPage />,
        handle: { title: "Team" },
      },
      {
        path: URLS.pricing,
        element: <PricingPage />,
        handle: { title: "Pricing" },
      },
    ],
  },
  // Not found route
  NOT_FOUND_ROUTE,
] satisfies IRoute[]) as RouteObject[]);
